/*Table structure for table `cp_info_mapping` */

DROP TABLE IF EXISTS `cp_info_mapping`;

CREATE TABLE `cp_info_mapping` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '映射流水号',
  `cp_id_third` varchar(32) NOT NULL COMMENT '第三方编号',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '第三方商户信息状态(1:正常  0:停用)',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `creator` int(10) unsigned DEFAULT NULL COMMENT '创建人',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `updator` int(10) unsigned DEFAULT NULL COMMENT '修改人',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  `channel_no` int(11) unsigned NOT NULL COMMENT '渠道商编号',
  `data` json DEFAULT NULL COMMENT '第三方公共信息:第三方商户名称、第三方字符编码格式、第三方签名类型、第三方商户支付KEY、第三方APP_ID、第三方登录用户名、第三方登录密码等',
  `cp_id` int(11) unsigned NOT NULL COMMENT '商户编号',
  `is_delete` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '0正常 非0已删除',
  `product_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '产品类型(1支付 2鉴权 3代付)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uniq_cp_id_third_cp_id_is_delete` (`cp_id_third`,`channel_no`,`is_delete`)
) ENGINE=InnoDB AUTO_INCREMENT=57 DEFAULT CHARSET=utf8 COMMENT='第三方商户信息映射表';

