/*Table structure for table `hx_mchid_key` */

DROP TABLE IF EXISTS `hx_mchid_key`;

CREATE TABLE `hx_mchid_key` (
  `id` int(6) NOT NULL AUTO_INCREMENT,
  `mch_id` varchar(10) NOT NULL COMMENT '商户号（海贝为第三方商户号）',
  `mch_name` varchar(10) NOT NULL COMMENT '商户简称(建议使用英文，否则编码异常)',
  `md5_key` varchar(50) NOT NULL COMMENT '商户KEY',
  `fee_rate` double DEFAULT NULL COMMENT '费率',
  `creattime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb4 COMMENT='海峡商户号对应KEY';

