/*Table structure for table `hx_trans_logs` */

DROP TABLE IF EXISTS `hx_trans_logs`;

CREATE TABLE `hx_trans_logs` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `mch_id` varchar(64) DEFAULT NULL COMMENT '商户号',
  `mch_name` varchar(64) DEFAULT NULL COMMENT '商户名称',
  `out_order_no` varchar(64) DEFAULT NULL COMMENT '平台订单号（海贝）',
  `order_no` varchar(64) DEFAULT NULL COMMENT '海峡平台订单号',
  `status` varchar(8) DEFAULT '0' COMMENT '0为未下载，非0为已下载',
  `payment_fee` int(12) DEFAULT '6' COMMENT '支付金额（分）',
  `refund_fee` int(12) DEFAULT '0' COMMENT '退款金额（分）',
  `cur_type` varchar(64) DEFAULT 'CNY' COMMENT '币种',
  `body` varchar(64) DEFAULT 'test' COMMENT '商品描述',
  `pay_platform` varchar(12) DEFAULT NULL COMMENT '支付平台',
  `pay_type` varchar(12) DEFAULT NULL COMMENT '支付类型',
  `ret_code` varchar(50) DEFAULT NULL COMMENT '返回码',
  `fee_rate` double DEFAULT NULL COMMENT '费率',
  `fee` int(12) DEFAULT NULL COMMENT '手续费',
  `order_status` varchar(2) DEFAULT NULL COMMENT '订单状态1-未支付；2-成功 3-失败',
  `notify_url` varchar(512) DEFAULT NULL COMMENT '支付通知',
  `bill_date` varchar(20) DEFAULT NULL COMMENT '订单日期',
  `creat_time` varchar(20) DEFAULT NULL COMMENT '订单生成时间',
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=416 DEFAULT CHARSET=utf8mb4 COMMENT='海峡渠道';

