  `orderNo` varchar(64) DEFAULT NULL COMMENT '退货订单号',
  `origOrderDate` varchar(64) DEFAULT NULL COMMENT '订单日期',
  `origOrderNo` varchar(64) DEFAULT NULL COMMENT '商户订单号',
  `notifyUrl` varchar(256) DEFAULT NULL COMMENT '异步通知地址',
  `returnUrl` varchar(256) DEFAULT NULL COMMENT '页面通知地址',
