/*Table structure for table `pf_trans_logs` */

DROP TABLE IF EXISTS `pf_trans_logs`;

CREATE TABLE `pf_trans_logs` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `requestNo` varchar(64) DEFAULT NULL COMMENT '交易请求流水号',
  `orderNo` varchar(64) DEFAULT NULL COMMENT '商户订单号/对应退款原订单号origOrderNo',
  `transId` varchar(64) DEFAULT NULL COMMENT '交易类型',
  `status` int(1) unsigned DEFAULT '0' COMMENT '0--未下载过的帐单，1---已被下载过的帐单',
  `pftransId` varchar(64) DEFAULT NULL COMMENT '浦发平台流水单号',
  `productId` varchar(64) DEFAULT NULL COMMENT '产品类型',
  `merNo` varchar(30) DEFAULT NULL COMMENT '商户号',
  `subMchId` varchar(64) DEFAULT NULL COMMENT '二级商户编号',
  `transAmt` int(12) DEFAULT NULL COMMENT '交易金额',
  `fee_rate` double DEFAULT NULL COMMENT '费率',
  `fee` int(12) DEFAULT NULL COMMENT '手续费',
  `payresult` varchar(2) DEFAULT '2' COMMENT '2-待支付，0-成功 1-失败',
  `notifyUrl` varchar(256) DEFAULT NULL COMMENT '异步通知地址',
  `commodityName` varchar(64) DEFAULT NULL COMMENT '商品名称',
  `orderDate` varchar(32) DEFAULT NULL COMMENT '订单时间/退货日期',
  `origOrderDate` varchar(32) DEFAULT NULL COMMENT '原订单日期',
  `origOrderNo` varchar(32) DEFAULT NULL COMMENT '原订单号',
  `returnUrl` varchar(256) DEFAULT NULL COMMENT '页面通知地址--退款用',
  `refundReson` varchar(32) DEFAULT NULL COMMENT '退款原因',
  `pfrefundId` varchar(32) DEFAULT NULL COMMENT '浦发退款单号',
  `creattime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
