/*Table structure for table `pf_trans_logs_old` */

DROP TABLE IF EXISTS `pf_trans_logs_old`;

CREATE TABLE `pf_trans_logs_old` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `requestNo` varchar(64) DEFAULT NULL COMMENT '交易请求流水号',
  `orderNo` varchar(64) DEFAULT NULL COMMENT '商户订单号',
  `transId` varchar(64) DEFAULT NULL COMMENT '交易类型',
  `status` int(1) DEFAULT '0' COMMENT '0--未下载过的帐单，1---已被下载过的帐单',
  `pftransId` varchar(64) DEFAULT NULL COMMENT '浦发平台流水单号',
  `productId` varchar(64) DEFAULT NULL COMMENT '产品类型',
  `merNo` varchar(30) DEFAULT NULL COMMENT '商户号',
  `subMchId` varchar(64) DEFAULT NULL COMMENT '二级商户编号',
  `transAmt` int(12) DEFAULT NULL COMMENT '交易金额',
  `payresult` varchar(2) DEFAULT '2' COMMENT '2-待支付，0-成功 1-失败',
  `notifyUrl` varchar(256) DEFAULT NULL COMMENT '异步通知地址',
  `commodityName` varchar(64) DEFAULT NULL COMMENT '商品名称',
  `orderDate` varchar(32) DEFAULT NULL COMMENT '订单时间',
  `creattime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='浦发业务流水表';

