/*Table structure for table `pf_wechatoa` */

DROP TABLE IF EXISTS `pf_wechatoa`;

CREATE TABLE `pf_wechatoa` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `requestNo` varchar(64) DEFAULT NULL COMMENT '请求流水号',
