  `transId` varchar(4) DEFAULT '28' COMMENT '交易类型',
  `agentId` varchar(64) DEFAULT NULL COMMENT '代理商号',
  `payWay` varchar(6) DEFAULT 'WX' COMMENT '支付渠道',
  `merNo` varchar(30) DEFAULT NULL COMMENT '商户号',
  `subMchId` varchar(30) DEFAULT NULL COMMENT '二级商户编号',
  `jsApiPath` varchar(256) DEFAULT NULL COMMENT '授权目录',
  `subAppId` varchar(32) DEFAULT NULL COMMENT '关联APPID',
  `subScribeAppid` varchar(32) DEFAULT NULL COMMENT '推荐关注APPID',
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 COMMENT='浦发公众号';

