DROP TABLE IF EXISTS `zx_trans_logs`;

CREATE TABLE `zx_trans_logs` (
  `id` int(32) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `mch_id` int(32) DEFAULT NULL COMMENT '商户号',
  `status` varchar(32) DEFAULT NULL COMMENT '状态',
